import React from 'react';
import './Login.css';
import logo from '../assets/logo.png';
import {Link} from 'react-router-dom';




export default function Login({history}){

    return(
        <div className="login-container">
            <form>
                <img src={logo} alt="Danimali" />
                <input type="text"/>
                <input type="password" />
                <button id="entrar" type="submit">Entrar</button>              
                <button id="cadastrar">
                    <Link> to="/cadastrar"</Link>Cadastrar</button>
                <button id="facebook" onClick="/main"></button>
                <h1><u>Esquici minha senha</u></h1>
            </form>

       </div>

    );
}
